from natasha import Doc, NewsEmbedding, NewsMorphTagger, NewsSyntaxParser, Segmenter, MorphVocab

segmenter = Segmenter()
emb = NewsEmbedding()
morph_tagger = NewsMorphTagger(emb)
syntax_parser = NewsSyntaxParser(emb)
morph_vocab = MorphVocab()

doc = Doc(dataset[0])
doc.segment(segmenter) # Uses Razdel internally.
print(doc.sents[:5])

doc.tag_morph(morph_tagger) #  Uses Slovnet morphology model internally.
print(doc.tokens[:5])

for token in doc.tokens:
  token.lemmatize(morph_vocab) #  Uses Pymorphy internally.
print(doc.tokens[:5])

